export default function Exercise({ id, name, muscle, equipment, image }) {
  const exercises = [
    { id: 1, name: 'Bench Press', muscle: 'Chest', equipment: 'Barbell' },
    { id: 2, name: 'Squats', muscle: 'Legs', equipment: 'Barbell' },
    { id: 3, name: 'Deadlifts', muscle: 'Back', equipment: 'Barbell' }
  ];
  return (
    <div className='exercise-container'>
      <div key={id} className='exercise'>
        <img src={image} alt={name} />
        <p className='exercise-detail'>
          {name} ({equipment})
        </p>
        <p className='exercise-muscle'>{muscle} </p>
      </div>
    </div>
  );
}
